const fs = require("fs");

function extractMedicines(inputString) {
  const regex = /<p class="med-name">(.*?)<\/p>/g;
  let medicines = [];
  let match;

  while ((match = regex.exec(inputString)) !== null) {
    medicines.push(match[1]);
  }

  return medicines;
}

